// import logo from './logo.svg';
import './App.css';
import './Header.js';
function App() {
  return (
    <div>
      <Header />
      <Text />
      <ul>
        <li>facebook</li>
        <li>youtube</li>
        <li>instagram</li>
      </ul>
    </div>
  );
}

// تصدير الدالة
export default App;
